import React from 'react';
import { ChakraProvider } from '@chakra-ui/react';
import Header from './components/Header';
import Hero from './components/Hero';
import About from './components/About';
import Skills from './components/Skills';
import Projects from './components/Projects';
import Contact from './components/Contact';
import Footer from './components/Footer';
import SEO from './components/SEO';

function App() {
  return (
    <ChakraProvider>
      <SEO 
        title="Kenneth's Portfolio" 
        description="Welcome to Kenneth's portfolio showcasing his skills, projects, and contact information." 
        keywords="front-end developer, React, Chakra UI, portfolio, Kenneth" 
        image="/path-to-your-default-image.jpg"
      />
      <Header />
      <Hero />
      <About />
      <Skills />
      <Projects />
      <Contact />
      <Footer />
    </ChakraProvider>
  );
}

export default App;
